window.bookSummaryJSON = "<p>In 1948, an alien starship crash-landed in the New Mexico desert and brought with it the key to mankind’s future. Code-named the Rho Project, the landing was shrouded in secrecy, and only the highest-ranking US government and military personnel knew it existed. Until now. </p> <p>The US president is preparing to unveil one of the nation’s greatest secrets when three students stumble across the wreckage of a second ship outside of Los Alamos. With a single touch, the alien technology the government has spent untold resources trying to unlock is uploaded into the minds of three teenagers — teenagers who now know the frightening truth about the Rho Project.The battle for humanity has begun.</p>"; 
